const  KeyApi = {
    render: ()=>{

        const API_PUB = process.env.REACT_APP_API_PUB_KEY;
        const hash = '64e20774a9bc0da1b2783e768cd14567';
        const URL_KEY = `https://gateway.marvel.com/v1/public/comics?ts=1&apikey=${API_PUB}&hash=${hash}`;

        fetch(URL_KEY)
        .then(res => res.json())
        .then((json) => {
        console.log(json.data.results)
    })
    }
}

KeyApi.render();
